		return attrMap;
	}

	@Override
	public Map<String, String> getDataMap() {
		Map<String, String> dataMap = new HashMap<String, String>();
		dataMap.put(XML_KEYWORD, keyword);
		dataMap.put(XML_URL, url);
		return dataMap;
	}

