			for (String s : sortedMap.keySet()) {
				boolean provided = false;
				for (String url : WebCommand.PROVIDED_URL) {
					if (s.equals(url)) {
						provided = true;
						break;
					}
				}
				String[] nextLine = {s, sortedMap.get(s)+"", provided+""};
				cw.writeNext(nextLine);
			}
			fw.close();
			cw.close();
		} catch (IOException e) {
			e.printStackTrace();
		} 
